export function Register(){
return (
    <div id="mainStorage">
        <h2>Register as a Volunteer</h2>
        <div id="stepbystep">
            <button id = "decreaseCirButton" onClick={decreaseCir()} style="width:20px;height:10px;background-color: bisque;"></button>
            <div className="dot" ><div className="insideDot">1</div></div> 
            <div className="line" ></div> 
            <div className="dot" ><div className="insideDot">2</div></div>
            <div className="line" ></div>
            <div className="dot" ><div className="insideDot">3</div></div>
            <button id="increaseCirButton" onClick={increaseCir()} style="width:20px;height:10px;background-color: bisque;"></button>
        </div>
        <div id="registerContentContainer" style="width: 500px; left: 30%; position: absolute; text-align: center;">
            <div id="registerPage0" className="registerPageContent">
                <h2>Welcome to [Hackathon Project Title]</h2><br/>
                <p style="font-size: large;">The [Hackathon Project Title] is an organization dedicated to connecting volunteers with organizations that need volunteers. 
                    We make it easy for you to help the community and to connect with scholarship programs that give grants to those active
                    in volunteering.<br/><br/>
                    In order to match you with relevant scholarships and volunteer projects, we need you to answer a couple questions.
                </p>
                <input type="checkbox" id="liabilityCheckbox" name="liabilityCheckbox" onClick={checkLiabilityFormBox(this)}></input>
                I have read and agree to the piracy policy<br/><button className="nextPage" id="page1NextPage" onClick={moveToPageTwo()}>Next</button>
                <br/>
                <span style={{"color":"red", fontSize: "12px",display:none}} id="page1Warning">You must agree to the privacy terms</span>
            </div>
            <div id="registerPage1" className="registerPageContent">
                <h2>User Info</h2>
                <label htmlFor="name">Name</label>
                <input type="text"/><br/>
                <label htmlFor="Age">Age</label>
                <input type="text"/><br/>
                <label htmlFor="Zip Code">Zip Code</label>
                <input type="text"/><br/>
                <label htmlFor="Address"></label>
                <input type="text"/><br/>


            </div>
            <div id="registerPage2" className="registerPageContent">Page 3</div>
        </div>

    </div>
);
}

let currentCir = 0;
let canGoNextPage = false;
function checkLiabilityFormBox(button){
    if(button.checked){
        allowNextPage();
    } else {
        disallowNextPage();
    }
}
function allowNextPage() {
    canGoNextPage = true;
    document.getElementById("page1NextPage").style.backgroundColor="lightgray";

}
function disallowNextPage() {
    canGoNextPage = false;
    document.getElementById("page1NextPage").style="darkgray";

}
let allCir = document.getElementsByClassName("dot");
function moveToPageTwo() {
    if(canGoNextPage){document.getElementById("page1Warning").style.display="block"; increaseCir();}
    else {document.getElementById("page1Warning").style.display="block";}
}
function decreaseCir() {
    if(currentCir==0) return;
    hidePage(currentCir);
    allCir[currentCir].style.backgroundColor = "#88F";
    currentCir--;
    allCir[currentCir].style.backgroundColor = "#5E3";
    loadPage(currentCir);
}
function increaseCir(){
    if(currentCir==allCir.length-1) return;
    hidePage(currentCir);
    allCir[currentCir].style.backgroundColor="#55D";
    currentCir++;
    allCir[currentCir].style.backgroundColor="#5E3"
    loadPage(currentCir);
    
}
allCir[currentCir].style.backgroundColor="#5E3";
loadPage(0);
function hidePage(num){
    document.getElementById("registerPage"+num).style.display="none";
}
function loadPage(num){
    document.getElementById("registerPage"+num).style.display="block";
    
}
